INSERT INTO `tbldailyquote` (`day`, `quote`) VALUES
(4, 'I PRAISE YOU BECAUSE I AM FEARFULLY AND WONDERFULLY MAD; <br> YOUR WORKS ARE WONDERFUL, I KNOW THAT FULL WELL.<br><br>Psalm 139:14 <br>'),
(30, 'Your word is a lamp to my feet and a light for my path'),
(2, 'Who god so love the world he give only begotten son'),
(1, 'Nobody can go back and start a new beginning but anyone can start today and make a new ending-Maria Robinson'),
(5, 'Lord, I have come to you for protection; <br> never let me be defeated! <br>Because you are righteous, help me and rescue me. <br> Listen to me and save me!<br><br>Psalm 71:1;2 <br>'),
(6, 'Create in me a pure heart, O God and renew a steadfast spirit within me.<br><br>Psalm 51:10 <br>'),
(7, 'Let the morning bring me word of your unfailing love,<br>\r\n						for I have put my trust in you. <br> Show me the way I should go for to you I lift up my soul.<br><br>Psalm 143:8 <br>'),
(8, 'Praise the Lord!  <br>  Praise God in his temple!  <br>  Praise his strength in heaven!  <br>  Praise him for the mighty things he has done.  <br>  Praise his supreme greatness.<br><br>Psalm 150:1;2 <br>'),
(9, 'But as for me, how wonderful to be near God, <br> to find protection with the Sovereign Lord and to proclaim all that he has done!<br><br>Psalm 73:28 <br>'),
(10, 'I thank you, Lord with all my heart, I sing praise to you before the Gods <br> I face your holy temple, <br> bow down, and praise your name because of your constant love and faithfulness, <br> because you have shown that your name and your commands are supreme.<br><br>Psalm 138:1;2 <br>'),
(11, 'Search me, O Lord and know my heart; test me and know my anxious thoughts. <br> See if there is any offensive way in me, and lead me in the way everlasting.<br><br>\r\n						Psalm 30:11 <br>'),
(12, 'Your ways O GOD are Holy. <br> What GOD is so great as our GOD? <br> You are the who performs miracles; <br> You display your power among the people.<br><br>Psalm 77:13,14 <br>'),
(13, 'Let thy steadfast Love, <br> Oh Lord, be upon us, <br> even as we hope in thee.<br><br>Psalm 33:22 <br>'),
(14, 'Let the words of my mouth and the meditation of my heart <br> be acceptable in thy sight O Lord, my rock and my redeemer.<br><br>Psalm 1,15:1 <br>'),
(15, 'To do your will O my God, is my desire; <br> your law is within my heart.<br><br>Psalm 40:8 <br>'),
(16, 'TEACH US TO NUMBER OUR DAYS ARIGHT <br> THAT WE MAY GAIN A HEART OF WISDOM.<br><br>Psalm 90:12 <br>'),
(17, 'But I call to the Lord God for help, and he will save me. <br> Morning, noon, and night my complaints and groans go up to him, and he will hear my voice. <br><br>Psalm 55:16;17 <br>'),
(18, 'Hear my prayer, O God; <br> don\'t turn away from my plea! <br> Listen to me and answer me; <br> I am worn out by my worries.<br><br>Psalm 55:1;2 <br>'),
(19, 'LORD GOD, MY SAVIOR, I CRY OUT ALL DAY, AND AT NIGHT I COME BEFORE YOU. <br> HEAR MY PRAYER, LISTEN TO MY CRY FOR HELP.<br><br>Psalm 88:1;2 <br>'),
(20, 'Whom have I in heaven but you? <br> And being with you, I desire nothing on earth.  <br>  My flesh and my heart may fall, but GOD is the strength of my heart and my portion forever. <br><br>Psalm 73:25 <br>'),
(21, 'Save me, Lord, from evil men; <br> Keep me safe from violent men.<br><br>Psalm 140:1 <br>'),
(22, 'In you, O Lord, I have taken refuge; <br> Let me never be put to shame.  <br> Rescue me and deliver me in your righteousness; <br> turn your ear to me and save me. <br> Be my rock of refuge, to which I can always go. <br><br>Psalm 71:1,3 <br>'),
(23, 'For you, O Lord, have delivered my soul from death, <br> my eyes from tears, my feet from stumbling. <br> that I may walk before the Lord in the land of the Living.<br><br>Psalm 116:8;9 <br>'),
(24, 'Because your love is better than Life, <br> My lips will glorify you, <br> I will praise you as long as I live... <br><br>Psalm 63:3,4 <br>'),
(25, 'May all who seek you rejoice and be glad in you; <br> May those who Love Your salvation always say, Let God be exalted! <br><br>Psalm 70:4 <br>'),
(26, 'Many, O Lord my God, are the wonders you have done. <br> The things you have planned for us no one can recount to you; <br> were I to speak and tell of them, <br> they would be too many to declare.<br><br>Psalm 40:5 <br>'),
(27, 'We give thanks to you, <br> O God, we give thanks to you! <br> We proclaim how great you are <br> and tell of the wonderful things you have done.<br><br>Psalm 75:1 <br>'),
(28, 'I RISE BEFORE DAWN AND CRY FOR HELP; <br> I HOPE IN THY WORDS. <br> MY EYES ARE AWAKE BEFORE THE WATCHES OF THE NIGHT, <br> THAT I MAY MEDITATE UPON THY PROMISE. <br><br>Psalm 119:147,148 <br>'),
(29, 'Praise the Lord, O my soul; I will praise the Lord all my life. I will sing praise to my God as long as I live.<br><br>Psalm 146:1'),
(3, 'I thank you now Lord for the recent blessings I received and for the blessing yet to come coz\' I know you are not done with me yet. In Jesus Name I pray amen.');
